    const [chiTown, setChiTown] = useState(true);

    const toggleGym = () => {
        setChiTown(!chiTown);
    };


    return (
      <div className = "home" >
        <button onClick={toggleGym}> Change Location</button>
        {chiTown ?
        <div>
        <h1>Welcome Home</h1>

            <h1>Chicago Fight Team</h1>
            <p>6528 S Lavernge Ave Chicago, Illinois</p>
            <p>1(773) 885-5700</p>
            <center>
                <iframe
